import React from 'react';


class Button extends React.Component {
    render() {
        return (
            <nav className="navbar navbar-default" >
                <div onClick={() => this.props.onLink()} className="container">
                    <p style={{cursor: 'pointer'}}className="navbar-brand">{this.props.text}</p>
                </div>
            </nav>
        )
    }
}

export default Button;
